const siteSelect = document.getElementById("site");
const segmentSelect = document.getElementById("segment");
const libelleSelect = document.getElementById("libelle");
const detailsTable = document.getElementById("details");
const detailsBody = detailsTable.querySelector("tbody");

// Remplir les sites
const sites = [...new Set(produits.map(p => p.site))];
sites.forEach(site => {
    const option = document.createElement("option");
    option.value = site;
    option.textContent = site;
    siteSelect.appendChild(option);
});

// Gérer la sélection de site
siteSelect.addEventListener("change", () => {
    const site = siteSelect.value;

    // Filtrer les segments
    const segments = [...new Set(produits.filter(p => p.site === site).map(p => p.segment))];
    segmentSelect.innerHTML = '<option value="">-- Choisissez un segment --</option>';
    segments.forEach(segment => {
        const option = document.createElement("option");
        option.value = segment;
        option.textContent = segment;
        segmentSelect.appendChild(option);
    });

    libelleSelect.innerHTML = '<option value="">-- Choisissez un produit --</option>';
    detailsTable.style.display = "none";
});

// Gérer la sélection de segment
segmentSelect.addEventListener("change", () => {
    const site = siteSelect.value;
    const segment = segmentSelect.value;

    // Filtrer les libellés
    const libelles = produits.filter(p => p.site === site && p.segment === segment).map(p => p.libelle);
    libelleSelect.innerHTML = '<option value="">-- Choisissez un produit --</option>';
    libelles.forEach(libelle => {
        const option = document.createElement("option");
        option.value = libelle;
        option.textContent = libelle;
        libelleSelect.appendChild(option);
    });

    detailsTable.style.display = "none";
});

// Gérer la sélection de produit
libelleSelect.addEventListener("change", () => {
    const site = siteSelect.value;
    const segment = segmentSelect.value;
    const libelle = libelleSelect.value;

    // Trouver le produit
    const produit = produits.find(p => p.site === site && p.segment === segment && p.libelle === libelle);

    if (produit) {
        detailsBody.innerHTML = `
            <tr>
                <td><img src="${produit.image}" alt="Image"></td>
                <td>${produit.nature}</td>
                <td>${produit.couleur}</td>
                <td>${produit.utilisation}</td>
                <td>${produit.prix_hors_tgap}</td>
                <td>${produit.prix_tgap}</td>
                <td>${produit.prix_tgap_rep}</td>
            </tr>
        `;
        detailsTable.style.display = "table";
    }
});
